import React from 'react';

const CheckBoxes = () => {
  const checked = true;
  return (
    <div>
      <input
        checked={checked}
        onChange={e => {
          console.log(e.target.value);
        }}
        type='checkbox'
      ></input>{' '}
      borders
    </div>
  );
};

export default CheckBoxes;
